import style from "./CartOrden.module.css";


const CartOrden = ({name, price, img, quantity})=>{
    return(
        <div id={style.CartOrden}>
            <div>
                <div>
                    <img src={img} alt={img} />
                </div>
                <div>
                    <label><h2>{name}</h2></label>
                </div>
            </div>
            <div></div>
            <div></div>
        </div>
    )
};

export default CartOrden
